sys_variable_value.value:
(function execute(inputs, outputs) {
    var eventId = inputs.eventId.trim();

	if (eventId.length == 0) {
		throw "Error while updating Event, invalid inputs have been passed.";
	}
	outputs.calendar_id = inputs.calendarId.trim() || "primary";
	outputs.event_id = eventId;

	var attendees = [],
		util = new GoogleHangoutsMeetUtil();

	inputs.attendeesToAdd.forEach(function (item) {
		item = item.trim();
		if (item.length == 0) {
			return;
		}
		if (item.length > 4 && util.isValidEmailAddress(item)) {
			attendees.push({
				"email": item
			});
		} else {
			throw "Invalid email address has been passed as input: " + item;
		}
	}, this);

	if (attendees.length == 0) {
		throw "List of attendees to be added is empty"
	}
	outputs.attendees = JSON.stringify(attendees.concat(inputs.existingAttendees || []));

})(inputs, outputs);

